  -webkit-text-stroke-width: 0.85px;
  -webkit-transform: scale(1.15, 1.1);
}
.icon-file-directory[data-name=".bundle"]:before {
  font-family: "Octicons Regular";
  font-size: medium;
  text-align: center;
  content: "\f0c4";
}
.icon-file-directory[data-name=".meteor"]:before {
  font-family: "devicons";
  font-size: large;
  text-align: center;
  top: 3px;
